import React from "react";
import { MDBBtn, MDBContainer } from "mdb-react-ui-kit";
import Nav from "./Nav";
import Main from "./Main";
import Footer from "./Footer";


const App = () => {
  return (
    <>
      {/* Main Navigation */}
      <Nav />
      
      {/* Main layout */}
      <Main />

      {/* Footer */}
      <Footer />

    </>
  );
}

export default App;
